INSERT INTO `wp_2_posts` VALUES (1,1,'2020-07-15 14:49:24','2020-07-15 14:49:24','Welcome to <a href=\"http://help2.ucdn.com/\"> Sites</a>. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2020-07-15 14:49:24','2020-07-15 14:49:24','',0,'https://help2.ucdn.com/ru/?p=1',0,'post','',1),(5,1,'2020-07-16 10:50:32','2020-07-16 10:50:32','','logo_t2','','inherit','open','closed','','logo_t2','','','2020-07-16 10:50:32','2020-07-16 10:50:32','',0,'https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/logo_t2.png',0,'attachment','image/png',0),(6,1,'2020-07-16 10:51:42','2020-07-16 10:51:42','','logo_fog','','inherit','open','closed','','logo_fog','','','2020-07-16 10:51:42','2020-07-16 10:51:42','',0,'https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/logo_fog.png',0,'attachment','image/png',0),(8,1,'2020-07-16 11:29:50','2020-07-16 11:29:50','https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/cropped-logo_fog.png','cropped-logo_fog.png','','inherit','open','closed','','cropped-logo_fog-png','','','2020-07-16 11:29:50','2020-07-16 11:29:50','',0,'https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/cropped-logo_fog.png',0,'attachment','image/png',0),(10,1,'2020-07-16 12:09:51','2020-07-16 12:09:51','https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/cropped-logo_fog-1.png','cropped-logo_fog-1.png','','inherit','open','closed','','cropped-logo_fog-1-png','','','2020-07-16 12:09:51','2020-07-16 12:09:51','',0,'https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/07/cropped-logo_fog-1.png',0,'attachment','image/png',0),(28,1,'2020-07-27 14:11:02','2020-07-27 14:11:02','<!-- wp:paragraph -->\n<p>Чтобы настроить пользовательские страницы ошибок для различных кодов ошибок http, сначала необходимо войти на my.ucdn.com. Затем нажмите  \"My zones\" в меню слева.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/myzones_new.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Вы увидите список ваших настроенных зон. Чтобы отредактировать расширенные настройки для зоны, нажмите на «шестерню» <img width=\"20\" height=\"25\" src=\"https://help.ucdn.com/images/icon-cp-settings.png\">справа.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To Чтобы настроить страницу ошибки, нажмите \"Error pages handling\":</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/error_handling.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Чтобы включить пользовательскую страницу для определенного кода ошибки, установите флажок перед HTTP код и введите полный URL-адрес в текстовом поле ниже.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/(page_errors.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Когда вы будете готовы, нажмите \"Save Changes\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете найти больше информации о кодах ошибок и их значении на <a href=\"https://en.wikipedia.org/wiki/List_of_HTTP_status_codes#4xx_Client_Error\">http://en.wikipedia.org/wiki/List_of_HTTP_status_codes</a> Метки: <a href=\"https://help.ucdn.com/tags/26/error-pages.html\">Error pages</a></p>\n<!-- /wp:paragraph -->','Страницы с ошибками','','publish','closed','closed','','%d0%a1%d1%82%d1%80%d0%b0%d0%bd%d0%b8%d1%86%d1%8b-%d1%81-%d0%be%d1%88%d0%b8%d0%b1%d0%ba%d0%b0%d0%bc%d0%b8','','','2020-07-27 14:11:02','2020-07-27 14:11:02','',0,'https://help2.ucdn.com/ru/?page_id=28',0,'page','',0),(29,1,'2020-07-27 14:11:02','2020-07-27 14:11:02','<!-- wp:paragraph -->\n<p>Чтобы настроить пользовательские страницы ошибок для различных кодов ошибок http, сначала необходимо войти на my.ucdn.com. Затем нажмите  \"My zones\" в меню слева.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/myzones_new.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Вы увидите список ваших настроенных зон. Чтобы отредактировать расширенные настройки для зоны, нажмите на «шестерню» <img width=\"20\" height=\"25\" src=\"https://help.ucdn.com/images/icon-cp-settings.png\">справа.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To Чтобы настроить страницу ошибки, нажмите \"Error pages handling\":</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/error_handling.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Чтобы включить пользовательскую страницу для определенного кода ошибки, установите флажок перед HTTP код и введите полный URL-адрес в текстовом поле ниже.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://help.ucdn.com/images/(page_errors.png\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Когда вы будете готовы, нажмите \"Save Changes\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете найти больше информации о кодах ошибок и их значении на <a href=\"https://en.wikipedia.org/wiki/List_of_HTTP_status_codes#4xx_Client_Error\">http://en.wikipedia.org/wiki/List_of_HTTP_status_codes</a> Метки: <a href=\"https://help.ucdn.com/tags/26/error-pages.html\">Error pages</a></p>\n<!-- /wp:paragraph -->','Страницы с ошибками','','inherit','closed','closed','','28-revision-v1','','','2020-07-27 14:11:02','2020-07-27 14:11:02','',28,'https://help2.ucdn.com/ru/2020/07/27/28-revision-v1/',0,'revision','',0),(36,1,'2020-08-24 09:26:40','2020-08-24 09:26:40','','logo_blue_orange_6','','inherit','open','closed','','logo_blue_orange_6','','','2020-08-24 09:26:40','2020-08-24 09:26:40','',0,'https://help2.ucdn.com/ru/wp-content/uploads/sites/2/2020/08/logo_blue_ora